
public class BridgesUniqueness {
    public static int length_of_subseq = 7;//the run of bases to be checked for commonality
    public static void main(String[] args) {
       //   String L1 = "----";        		
      //  String L1 = "------------------";
        
    	//re-arrangged
    	//String L1 = "";
        
    	//original
    	//String L1 = "";
    
    	String L1 = "";
    	
        String [] common_sub = new String[4*L1.length()];
        int found_index=0;
        for (int i=0;i<(L1.length()-length_of_subseq+1);i++){
            String current = L1.substring(i, i+length_of_subseq);
            for (int j=i+1;j<(L1.length()-length_of_subseq+1);j++){               
                if(current.equals(L1.subSequence(j, j+length_of_subseq))){
                    common_sub[found_index]= (String)L1.subSequence(j, j+length_of_subseq);
                    found_index++;
                }
            }
        }
        System.out.println("length "+L1.length()+"\nunit "+length_of_subseq+"\nrepeats "+found_index);
        int no_dash =0;
        for(int x=0;x<found_index;x++){
        	if (!common_sub[x].toString().contains("-")){
        			//System.out.print("\ncommon: "+common_sub[x]);
        			no_dash++;
        		}
        }
        System.out.println("\n\nwithout dash  "+no_dash);
       
    }
}

